import './workExperienceCSS.css'
import { WorkExperienceModel } from '../model/workExperience';
import {useState, useEffect} from 'react'


function WorkExperience() {


    const [workExperienceFormGroup, setWorkExperienceFormGroup] = useState([{}]);

    function addWorkExperience() {
        // setWorkExperienceFormGroup([...workExperienceFormGroup, {}])

        setWorkExperiences([...workExperiences, {
            "title": "",
            "company": "",
            "startDateMonth": "",
            "startDateYear": "",
            "endDateMonth": "",
            "endDateYear": "",
            "currentlyWorkHere": "",
            "locationCityState": "",
            "new": true
        }])
        console.log('add work experience plus clicked')
    }


    const [workExperiences, setWorkExperiences] = useState(null)

    useEffect(() => {
        console.log('in use effect')
            const getWorkExperiences = async() => {
                console.log('in workExperience function')
                let workExperienceModel = new WorkExperienceModel()

                try {
                    // let educationModel = new EducationModel()
                    let workExperiences = await workExperienceModel.getWorkExperiences()
                    console.log('here')
                    console.log(`workExperiences ${workExperiences}`)
                    setWorkExperiences(workExperiences)
                }
                catch (error) {
                    console.log('here2');
                    setWorkExperiences(null)
                }
            }
            getWorkExperiences();


    }, [])

    return (
        <div class='container'>
        <form>
            <div class='workExperience-border'>
                <h1 class='workExperience'>Work Experience</h1>
                <hr></hr>

                {workExperiences != null ? workExperiences.map((workExperience) => (
                    <div>
                        {workExperienceFormGroup.map(() => (
                            <div class = 'workExperienceFormGroup'>
                                <div class='form-group'>
                                    <label>Title</label>
                                    <input style = {{width: `${workExperience.title.length}ch`}} type="text" placeholder={workExperiences == null ? 'Title' : null} value = {workExperiences != null ? workExperience.title : null}/>
                                </div>

                                <div class='form-group'>
                                    <label>Company</label>
                                    <input style = {{width: `${workExperience.company.length}ch`}} type="text" placeholder={workExperiences == null ? 'Company' : null} value = {workExperiences != null ? workExperience.company : null}/>
                                </div>

                                {/* change to date picker */}
                                <div class='form-group'>
                                    <label>Start Date</label>
                                    <input style = {{width: `${workExperience.startDateMonth.length + workExperience.startDateYear.length}ch`}} type="text" placeholder={workExperiences == null ? 'Start Date' : null} value = {workExperiences != null ? `${workExperience.startDateMonth} ${workExperience.startDateYear}` : null}/>
                                </div>

                                {workExperience.currentlyWorkHere == 1 ? (
                                    <div class='form-group'>
                                        <label>Currently Work Here</label>
                                        <input checked = {workExperience.currentlyWorkHere} type="checkbox"/>
                                    </div>
                                ) : (
                                    <div class='form-group'>
                                        <label>End Date</label>
                                        {/* add regex for checking input of this field to match Month, Year format (same for start date input field) */}
                                        <input style = {{width: `${workExperience.endDateMonth.length + workExperience.endDateYear.length}ch`}} type="text" placeholder={workExperiences == null ? 'End Date' : null} value = {workExperiences != null ? `${workExperience.endDateMonth} ${workExperience.endDateYear}` : null}/>
                                    </div>
                                )}


                                <div class='form-group'>
                                    <label>City, State</label>
                                    <input style = {{width: `${workExperience.locationCityState.length}ch`}} type="text" placeholder={workExperiences == null ? 'City, State' : null} value = {workExperiences != null ? workExperience.locationCityState : null}/>
                                </div>

                                <div class='form-group'>
                                    <label>Work Responsibilities</label>
                                    <input style = {{width: `${workExperience.workResponsibilities.length}ch`}} type="textarea" placeholder={workExperiences == null ? 'Work Responsibilities' : null} value = {workExperiences != null ? workExperience.workResponsibilities : null}/>
                                </div>

                                {workExperienceFormGroup.length > 1 || workExperiences.length > 1 ? (<hr class='workExperienceDivider'></hr>) : (null)}

                            </div>
                        ))}                        
                    </div>
                )) : null}

                <h1 id='plus' onClick={()=>addWorkExperience()}>+</h1>

            </div>
        </form>

    </div>
    )
}

export default WorkExperience;
